	/* Destroy the stack itself. */
	surf_parse_free((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Destroy the start condition stack. */
        surf_parse_free((yy_start_stack)  );
        (yy_start_stack) = NULL;

